import React from 'react';
import './styles/App.css';

const Header = () => {
	return (
		<div>
			<div>a</div>
			<div>b</div>
		</div>
	);
};

const App = () => {
	return (
		<div>
			<Header />
			<div className="App">
				<ul>
					<li>aa</li>
					<li>bb</li>
				</ul>
			</div>
		</div>
	);
};

export default App;
